console.log(honda)
let tesla = cars[1];
console.log(tesla)
let hondaTopSpeed = honda.speedStats;
console.log(hondaTopSpeed)
let teslaTopSpeed = tesla.speedStats;
console.log(teslaTopSpeed)
let hondaTopColour = honda.coloursByPopularity;
let teslaTopColour = tesla.coloursByPopularity;

ReactDOM.render(
  <table>
    <tr>
      <th>{model}</th>
      <th>{speedStats.topSpeed}</th>
    </tr>
    <tr>
      <td>{honda.model}</td>
      <td>{hondaTopSpeed}</td>
      <td>{hondaTopColour}</td>
    </tr>
    <tr>
      <td>{tesla.model}</td>
      <td>{teslaTopSpeed}</td>
      <td>{teslaTopColour}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
